import React from "react";
import { Link, useHistory } from "react-router-dom";
import Logo from "../assets/img/logo2.png";

import HouseList from "./HouseList";

const Header = () => {
  const history = useHistory();

  const handleScrollToModule = () => {
    // Assuming houses[0] is the module you want to scroll to
    history.push(`/property/${houses[0].id}`);
  };

  const handleScrollToVilla = () => {
    // Assuming houses[1] is the villa you want to scroll to
    history.push(`/property/${houses[1].id}`);
  };
  return (
    <header className="py-3 mb-3 border-b">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/">
          <img src={Logo} alt="logo modulhome" />
        </Link>

        <div className="flex items-center gap-6">
          <Link className=" hover:text-violet-600 transition " to="#" onClick={handleScrollToModule}>
            Modules
          </Link>
          <Link
            className=" bg-violet-700 text-white hover:bg-violet-900 px-4 py-3 rounded-lg transition "
            to="#"
            onClick={handleScrollToVilla}
          >
            Villas
          </Link>
          <div>
            <HouseList />
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
